import React from 'react';
import './App.css';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';

class MomentCard extends React.Component {
    state = {
        active: false
    }

    useStyles() {
        return makeStyles({
          root: {
            minWidth: 275,
          },
          bullet: {
            display: 'inline-block',
            margin: '0 2px',
            transform: 'scale(0.8)',
          },
          title: {
            fontSize: 14,
          },
          pos: {
            marginBottom: 12,
          },
        });
    }

    render() {
        const classes = this.useStyles();

        if (this.state.active) {
            return (
                <div></div>
            )
        }

        return (
            <Card className={classes.root}>
                <p>This is where my MomentCard is going to be</p>
            </Card>
        )
    }
}

export default MomentCard;
